import model from "../model/model";

class QuestionsListPresenter {
    onCreate(){
        model.addQuestion(model.state.newQuestion.title,model.state.newQuestion.question);
        model.changeNewQuestionProperty("titleInput", "");
        model.changeNewQuestionProperty("questionInput", "");


    }

    onChange(property, value){
        model.changeNewQuestionProperty(property, value);
    }
}
const studentsListPresenter = new QuestionsListPresenter();
export default studentsListPresenter;
